public static class Snippet
{
	public static System.String func(ref System.Data.DataColumn[] myColumn)
	{
		try
		{
		var myNewColumn = new DataColumn[] 
			{new DataColumn("PosNr"),
			 new DataColumn("Artikel"), 
			 new DataColumn("Bezeichnung"), 
			 new DataColumn("Menge"), 
			 new DataColumn("Einheit"),
			 new DataColumn("VKPreis"), 
			 new DataColumn("Zeilenwert"),
			 new DataColumn("Bild") 
			};

		       myColumn = myNewColumn;
		}
		catch (Exception e)
		{
		  return e.Message;
		}
		return "";
	}

}
